  `MINI_PAYMENT` decimal(18,2) DEFAULT NULL COMMENT '当期最低还款额',
  `LAST_BAL` decimal(18,2) DEFAULT NULL COMMENT '期初余额',
  `DC_FLAG` char(1) DEFAULT NULL COMMENT '新增金额借贷标识',
  `CONSUMPTION_AMT` decimal(18,2) DEFAULT NULL COMMENT '当期新增消费金额',
  `ENCASHMENT_FLAG` char(1) DEFAULT NULL COMMENT '当期新增取现金额借贷标识',
  `ENCASHMENT_AMT` decimal(18,2) DEFAULT NULL COMMENT '当期新增取现金额',
  `REPAYMENT_FLAG` char(1) DEFAULT NULL COMMENT '当期还款金额借贷标识',
  `REPAYMENT_AMT` decimal(18,2) DEFAULT NULL COMMENT '当期已还款金额',
  `REJECT_FLAG` char(1) DEFAULT NULL COMMENT '当期退货金额借贷标识',
  `REJECT_AMT` decimal(18,2) DEFAULT NULL COMMENT '当期退货金额',
  `ANNUAL_FEE` decimal(18,2) DEFAULT NULL COMMENT '年费金额',
  `SURCHARGE` decimal(18,2) DEFAULT NULL COMMENT '滞纳金',
  `INTEREST` decimal(18,2) DEFAULT NULL COMMENT '应收利息',
  `ENCASHMENT_FEE` decimal(18,2) DEFAULT NULL COMMENT '取现手续费金额',
  `OTHER_FEE` decimal(18,2) DEFAULT NULL COMMENT '其它费用金额',
  `NEW_INSTALLMENT_AMT` decimal(18,2) DEFAULT NULL COMMENT '当期新增分期金额',
  `OVERDUE_AMT30` decimal(18,2) DEFAULT NULL COMMENT '逾期30天金额',
  `OVERDUE_AMT60` decimal(18,2) DEFAULT NULL COMMENT '逾期60天金额',
  `OVERDUE_AMT90` decimal(18,2) DEFAULT NULL COMMENT '逾期90天金额',
  `OVERDUE_AMT120` decimal(18,2) DEFAULT NULL COMMENT '逾期120天金额',
  `OVERDUE_AMT150` decimal(18,2) DEFAULT NULL COMMENT '逾期150天金额',
  `OVERDUE_AMT180` decimal(18,2) DEFAULT NULL COMMENT '逾期180+天金额',
  `BILL_CONSUMPTION` decimal(18,2) DEFAULT NULL COMMENT '已出账单消费金额',
  `BILL_ENCASHMENT` decimal(18,2) DEFAULT NULL COMMENT '已出账单取现金额',
  `BILL_COST` decimal(18,2) DEFAULT NULL COMMENT '已出账单费用金额',
  `BILL_INTEREST` decimal(18,2) DEFAULT NULL COMMENT '已出账单利息金额',
  `BILL_INSTALLMENT` decimal(18,2) DEFAULT NULL COMMENT '已出账单分期付款金额',
  `COMPOUND_AMT` decimal(18,2) DEFAULT NULL COMMENT '复利金额',
  `DEBIT_ADJUSTMENT_AMT` decimal(18,2) DEFAULT NULL COMMENT '借记调整金额',
  `CREDIT_ADJUSTMENT_AMT` decimal(18,2) DEFAULT NULL COMMENT '贷记调整金额',
  `RECENT_REPAYMENT_STAT` varchar(24) DEFAULT NULL COMMENT '最近24个月还款状态',
  `OPEN_BAL_SIGN` char(1) DEFAULT NULL COMMENT '期初余额符号',
  `BAL_INT_SIGN` char(1) DEFAULT NULL COMMENT '已出账单取现金额符号',
  `LAST_FILE_DATE` date NOT NULL COMMENT '文件名日期',
  PRIMARY KEY (`ID`),
  KEY `IDX_T_BILL_INFO_1` (`ISSUER_CODE`,`CCC_ID`) USING BTREE,
  KEY `IDX_T_BILL_INFO_FILE_DATE` (`LAST_FILE_DATE`) USING BTREE,
  KEY `IDX_T_BILL_INFO_CardnoBillmonth` (`CARD_NO`,`BILL_MONTH`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='账单信息表';

