-- ----------------------------
--  Table structure for `T_CM_COMPANY`
-- ----------------------------
DROP TABLE IF EXISTS `T_CM_COMPANY`;
CREATE TABLE `T_CM_COMPANY` (
  `COMPANY_ID` varchar(32) NOT NULL COMMENT '企业ID  ',
  `COMPANY_CODE` varchar(100) DEFAULT NULL COMMENT '企业代码',
  `COMPANY_NAME` varchar(200) NOT NULL DEFAULT '' COMMENT '企业名称',
  `COMPANY_ABBR` varchar(100) NOT NULL DEFAULT '' COMMENT '企业简称',
  `PARENT_COMPANY_ID` varchar(32) DEFAULT NULL COMMENT '父级企业ID',
  `COMPANY_SCALE` varchar(10) DEFAULT NULL COMMENT '企业规模',
  `INDUSTRY_QUALITY` varchar(20) DEFAULT NULL COMMENT '行业性质',
  `INDUSTRY_ID` varchar(32) DEFAULT NULL COMMENT '所属行业',
  `ADDR_ID` varchar(32) DEFAULT NULL COMMENT '所属地址',
  `CHARTER_NUM` varchar(50) NOT NULL DEFAULT '' COMMENT '营业执照号码',
  `TAX_REG_CERT` varchar(50) DEFAULT NULL COMMENT '税务登记证号码',
  `ORG_CODE` varchar(50) NOT NULL DEFAULT '' COMMENT '组织机构代码',
  `LEGAL_PERSON_NAME` varchar(50) DEFAULT NULL COMMENT '法人',
  `COMPANY_PHONE` varchar(50) DEFAULT NULL COMMENT '企业电话',
  `LINKMAN` varchar(100) DEFAULT NULL COMMENT '联系人',
  `LINKMAN_POSTCODE` int(10) DEFAULT NULL COMMENT '联系人邮编',
  `LINKMAN_EMAIL` varchar(50) DEFAULT NULL COMMENT '联系人邮箱',
  `LINK_FAX` varchar(50) DEFAULT NULL COMMENT '联系人传真',
  `DELETE_FLAG` char(1) DEFAULT '0' COMMENT '删除标志  0 未删除 1已删除  默认 0',
  `CREATE_TIME` varchar(50) DEFAULT NULL COMMENT '创建时间',
  `LAST_MODIFY_TIME` varchar(50) DEFAULT NULL COMMENT '最后修改时间',
  `OP_USER` varchar(32) NOT NULL DEFAULT '' COMMENT '操作人',
  `MEMO` varchar(60) DEFAULT NULL COMMENT '备注',
  `CHILD_COMPANY_FLAG` char(1) DEFAULT NULL,
  `COMPANY_NO` varchar(100) DEFAULT NULL,
  `UNIPAY_FLAG` char(1) DEFAULT '0' COMMENT ' 银联标识  1 是 0否 默认0',
  `VIRTUAL_FLAG` char(1) DEFAULT '0' COMMENT '虚拟银行标志 0否 1是',
  `LEG_CERT_TYPE` varchar(2) DEFAULT NULL,
  `LEG_CERT_NO` varchar(30) DEFAULT NULL,
  `LEG_CERT_MOBILE` varchar(11) DEFAULT NULL,
  `LINKMAN_JOB` varchar(50) DEFAULT NULL,
  `LINKMAN_DEPARTMENT` varchar(50) DEFAULT NULL,
  PRIMARY KEY (`COMPANY_ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

