-- ----------------------------
--  Table structure for `T_CM_COMPANY_BANK`
-- ----------------------------
DROP TABLE IF EXISTS `T_CM_COMPANY_BANK`;
CREATE TABLE `T_CM_COMPANY_BANK` (
