  `BANK_ID` varchar(32) NOT NULL COMMENT '银行ID',
  `COMPANY_ID` varchar(32) NOT NULL COMMENT '企业ID',
  `CREATE_TIME` varchar(50) DEFAULT NULL COMMENT '创建时间',
  `LAST_MODIFY_TIME` varchar(50) DEFAULT NULL COMMENT '最后修改时间',
  `OP_USER` varchar(32) DEFAULT NULL COMMENT '操作人',
  `MEMO` varchar(60) DEFAULT NULL COMMENT '备注',
  PRIMARY KEY (`ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

-- ----------------------------
--  Table structure for `T_CM_DEPARTMENT`
-- ----------------------------
DROP TABLE IF EXISTS `T_CM_DEPARTMENT`;
CREATE TABLE `T_CM_DEPARTMENT` (
  `DEPARTMENT_ID` varchar(32) NOT NULL COMMENT 'PK',
  `DEPARTMENT_NAME` varchar(100) NOT NULL COMMENT '部门名字',
  `DEPARTMENT_NO` varchar(50) DEFAULT NULL COMMENT '部门编码',
  `DEPARTMENT_DUTY` varchar(500) NOT NULL COMMENT '部门职责',
  `DEPARTMENT_MANAGER` varchar(50) DEFAULT NULL COMMENT '部门经理',
  `DEPARTMENT_PHONE` varchar(50) DEFAULT NULL COMMENT '部门电话',
  `DEPARTMENT_FAX` varchar(50) DEFAULT NULL COMMENT '部门传真',
  `DEPARTMENT_EMAIL` varchar(50) DEFAULT NULL COMMENT '部门EMAIL ',
  `CREATE_TIME` varchar(50) DEFAULT NULL COMMENT '创建时间',
