-- ----------------------------
--  Table structure for `T_CM_OPER_LOG`
-- ----------------------------
DROP TABLE IF EXISTS `T_CM_OPER_LOG`;
CREATE TABLE `T_CM_OPER_LOG` (
  `ID` varchar(32) NOT NULL COMMENT 'PK',
  `EXECUTE_DATE` date DEFAULT NULL COMMENT '执行日期',
  `EXECUTE_TIME` time DEFAULT NULL COMMENT '执行时间',
  `MENU_NAME` varchar(500) DEFAULT NULL COMMENT '菜单名称',
  `OPER_WAY` varchar(500) DEFAULT NULL COMMENT '操作名称',
  `OPER_DESC` varchar(500) DEFAULT NULL COMMENT '操作描述',
  `OPER_NAME` varchar(50) DEFAULT NULL COMMENT '操作员',
  `BRANCH_NAME` varchar(200) DEFAULT NULL COMMENT '部门代码/名称',
  `COMPANY_NAME` varchar(200) DEFAULT NULL COMMENT '公司/银行名称',
  `RSP_CODE` char(6) DEFAULT NULL COMMENT '操作结果',
  `RSP_MSG` varchar(128) DEFAULT NULL COMMENT '响应信息',
  `IP` varchar(50) DEFAULT NULL COMMENT '客户IP',
  `COST_TIME` int(11) DEFAULT NULL COMMENT '耗时',
  `MEMO` varchar(60) DEFAULT NULL COMMENT '备用',
  `LOG_TYPE` char(1) DEFAULT NULL COMMENT '日志类型(0:访问日志，1:操作日志)',
  `PLATFORM_FLAG` char(1) DEFAULT NULL COMMENT '访问平台类型(0:运营支撑门户,1:前端门户)',
  PRIMARY KEY (`ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

-- ----------------------------
--  Table structure for `T_CM_PARM`
-- ----------------------------
DROP TABLE IF EXISTS `T_CM_PARM`;
CREATE TABLE `T_CM_PARM` (
  `ID` varchar(32) NOT NULL COMMENT 'PK',
  `PARM_ID` varchar(20) NOT NULL COMMENT '参数标识',
  `PARM_FLAG` char(2) NOT NULL COMMENT '参数类别',
  `PARM_TYPE` char(2) NOT NULL COMMENT '业务类别',
  `PARM_NAME` varchar(60) NOT NULL COMMENT '参数名称',
  `PARM_DESC` varchar(60) NOT NULL COMMENT '参数描述',
  `PARM_VALUE` varchar(128) NOT NULL COMMENT '参数值',
  `CREATE_TIME` datetime NOT NULL COMMENT '添加时间',
  `UPDATE_TIME` datetime DEFAULT NULL COMMENT '修改时间',
  `MEMO` varchar(40) DEFAULT NULL COMMENT '备用',
  `OP_USER` varchar(32) DEFAULT NULL COMMENT '维护操作员',
  PRIMARY KEY (`ID`),
  UNIQUE KEY `IDX_T_CM_PARM_UNI_1` (`PARM_ID`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

