-- ----------------------------
--  Table structure for `T_CM_USER`
-- ----------------------------
DROP TABLE IF EXISTS `T_CM_USER`;
CREATE TABLE `T_CM_USER` (
  `USER_ID` varchar(32) NOT NULL COMMENT 'PK',
  `LOGIN_NAME` varchar(50) NOT NULL COMMENT '登录名',
  `LOGIN_PWD` varchar(512) NOT NULL COMMENT '密码',
  `REAL_NAME` varchar(50) DEFAULT NULL COMMENT '真实姓名',
  `IDENTITY_CARD` varchar(50) DEFAULT NULL COMMENT '身份证',
  `USER_NO` varchar(50) DEFAULT NULL COMMENT '用户编码',
  `USER_EMAIL` varchar(50) DEFAULT NULL COMMENT 'EMAIL',
  `USER_NICKNAME` varchar(50) DEFAULT NULL COMMENT '昵称',
  `USER_BIRTHDAY` varchar(20) DEFAULT NULL COMMENT '用户生日',
  `USER_CONSTELLATI` varchar(20) DEFAULT NULL COMMENT '用户星座',
  `USER_AGE` int(11) DEFAULT NULL COMMENT '年龄',
  `USER_PHONE` varchar(50) DEFAULT NULL COMMENT '用户电话',
  `MOBILE` varchar(50) DEFAULT NULL COMMENT '用户手机号',
  `USER_QQ` varchar(50) DEFAULT NULL COMMENT 'QQ',
  `SEX_FLAG` char(1) NOT NULL DEFAULT '1' COMMENT '用户性别  0:女1:男',
  `COMPANY_ID` varchar(32) DEFAULT NULL COMMENT '所属公司ID',
  `DEPARTMENT_ID` varchar(32) NOT NULL COMMENT '所属部门ID',
  `CREATE_TIME` varchar(50) DEFAULT NULL COMMENT '创建时间',
  `LAST_MODIFY_TIME` varchar(50) DEFAULT NULL COMMENT '最后修改时间',
  `OP_USER` varchar(32) NOT NULL COMMENT '操作人',
  `USER_STATE` char(1) DEFAULT '1' COMMENT ' 性别 1正常 0禁用 默认1',
  `JOIN_TIME` varchar(50) DEFAULT NULL COMMENT '入职时间',
  `POSITION_STATE` char(1) DEFAULT '1' COMMENT ' 在职状态 0试用 1正式',
  `POSITION_ID` varchar(32) DEFAULT NULL COMMENT '所属职位ID',
  `MEMO` varchar(30) DEFAULT NULL COMMENT '备用',
  `USER_TYPE` char(1) DEFAULT '1' COMMENT '用户类型  用户类型:1:业务人员,用户类型:2:管理人员，默认1',
  `USER_FLAG` char(1) DEFAULT '0' COMMENT '用户标识 1 内部人员 2 企业用户  3 银行用户，4企业运维 5银行运维默认1',
  `SYS_TYPE` char(1) DEFAULT '1' COMMENT '1、运维支撑 2、门户  默认  1',
  `DELETE_FLAG` char(1) DEFAULT '0' COMMENT '删除标志  0 未删除 1已删除  默认 0',
  `BANK_ID` varchar(32) DEFAULT NULL COMMENT '银行ID',
  `IS_FIRST_LOG` char(1) DEFAULT '1' COMMENT '是否是第一次登录 0否 1是',
  PRIMARY KEY (`USER_ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

