-- ----------------------------
--  Function structure for `currval`
-- ----------------------------
DROP FUNCTION IF EXISTS `currval`;
delimiter ;;
CREATE DEFINER=`root`@`localhost` FUNCTION `currval`(seq_name VARCHAR(50)) RETURNS bigint(20)
BEGIN  
         DECLARE value BIGINT;  
         SELECT current_value INTO value  
         FROM sequence  
         WHERE upper(name) = upper(seq_name); -- 大小写不区分.  
         RETURN value;  
END
 ;;
delimiter ;

-- ----------------------------
--  Function structure for `getAreaCodeLst`
-- ----------------------------
DROP FUNCTION IF EXISTS `getAreaCodeLst`;
delimiter ;;
CREATE DEFINER=`root`@`localhost` FUNCTION `getAreaCodeLst`(rootId VARCHAR(50)) RETURNS varchar(1000) CHARSET utf8
BEGIN
       DECLARE sTemp VARCHAR(1000);
      DECLARE sTempChd VARCHAR(1000);
   
       SET sTemp = '';
       SET sTempChd ='';
    
       WHILE sTempChd IS NOT NULL DO
         SET sTemp = CONCAT(sTemp,'/',sTempChd);
         SELECT GROUP_CONCAT(AREA_CODE) INTO sTempChd FROM T_CM_AREA_CODE WHERE FIND_IN_SET(UP_AREA_CODE,sTempChd)>0;
       END WHILE;
       RETURN sTemp;
     END
 ;;
delimiter ;

-- ----------------------------
--  Function structure for `getBankParentLst`
-- ----------------------------
DROP FUNCTION IF EXISTS `getBankParentLst`;
delimiter ;;
CREATE DEFINER=`root`@`localhost` FUNCTION `getBankParentLst`(rootId VARCHAR(50)) RETURNS varchar(1000) CHARSET utf8
BEGIN
       DECLARE sTemp VARCHAR(1000);
      DECLARE sTempChd VARCHAR(1000);
   
       SET sTemp = '$';
       SET sTempChd =rootId;
    
       WHILE sTempChd IS NOT NULL DO
         SET sTemp = CONCAT(sTemp,',',sTempChd);
         SELECT GROUP_CONCAT(BANK_ID) INTO sTempChd FROM T_CM_BANK WHERE FIND_IN_SET(PARENT_BANK_ID,sTempChd)>0;
       END WHILE;
       RETURN sTemp;
     END
 ;;
delimiter ;

-- ----------------------------
--  Function structure for `getChildLst`
-- ----------------------------
DROP FUNCTION IF EXISTS `getChildLst`;
delimiter ;;
CREATE DEFINER=`root`@`localhost` FUNCTION `getChildLst`(rootId varchar(11)) RETURNS varchar(1000) CHARSET utf8
BEGIN
      DECLARE sTemp VARCHAR(1000);
      DECLARE sTempChd VARCHAR(1000);
    
      SET sTemp = '';
      SET sTempChd =rootId;
       WHILE sTempChd is not null DO
         SET sTemp = concat(sTemp,',',sTempChd);
         SELECT group_concat(id) INTO sTempChd FROM treeNodes where FIND_IN_SET(pid,sTempChd)>0;
       END WHILE;
       RETURN sTemp;
     END
 ;;
delimiter ;

-- ----------------------------
--  Function structure for `getCompanyChildLst`
-- ----------------------------
DROP FUNCTION IF EXISTS `getCompanyChildLst`;
delimiter ;;
CREATE DEFINER=`root`@`localhost` FUNCTION `getCompanyChildLst`(rootId varchar(50)) RETURNS varchar(1000) CHARSET utf8
BEGIN
       DECLARE sTemp VARCHAR(1000);
      DECLARE sTempChd VARCHAR(1000);
   
       SET sTemp = '$';
       SET sTempChd =rootId;
    
       WHILE sTempChd is not null DO
         SET sTemp = concat(sTemp,',',sTempChd);
         SELECT group_concat(COMPANY_ID) INTO sTempChd FROM T_CM_COMPANY where FIND_IN_SET(PARENT_COMPANY_ID,sTempChd)>0;
       END WHILE;
       RETURN sTemp;
     END
 ;;
delimiter ;

-- ----------------------------
--  Function structure for `getCompanyChildLst_1`
-- ----------------------------
DROP FUNCTION IF EXISTS `getCompanyChildLst_1`;
delimiter ;;
CREATE DEFINER=`root`@`localhost` FUNCTION `getCompanyChildLst_1`(rootId VARCHAR(50)) RETURNS varchar(1000) CHARSET utf8
BEGIN
       DECLARE sTemp VARCHAR(1000);
      DECLARE sTempChd VARCHAR(1000);
   
       SET sTemp = '$';
       SET sTempChd =rootId;
    
       WHILE sTempChd IS NOT NULL DO
         if  sTempChd <> rootId then          
          SET sTemp = CONCAT(sTemp,',',sTempChd);
         end if;
         SELECT GROUP_CONCAT(COMPANY_ID) INTO sTempChd FROM T_CM_COMPANY WHERE FIND_IN_SET(PARENT_COMPANY_ID,sTempChd)>0;
       END WHILE;
       RETURN sTemp;
     END
 ;;
delimiter ;

-- ----------------------------
--  Function structure for `getCompanyParentLst`
-- ----------------------------
DROP FUNCTION IF EXISTS `getCompanyParentLst`;
delimiter ;;
CREATE DEFINER=`root`@`localhost` FUNCTION `getCompanyParentLst`(childId varchar(50)) RETURNS varchar(1000) CHARSET utf8
BEGIN
       DECLARE sTemp VARCHAR(1000);
      DECLARE sTempPid VARCHAR(1000);
   
       SET sTemp = '$';
       SET sTempPid =childId;
    
       WHILE sTempPid is not null DO
         SET sTemp = concat(sTemp,',',sTempPid);
         SELECT group_concat(PARENT_COMPANY_ID) INTO sTempPid FROM T_CM_COMPANY where FIND_IN_SET(COMPANY_ID,sTempPid)>0;
       END WHILE;
       RETURN sTemp;
     END
 ;;
delimiter ;

